import Layout from "../../nextjs1/components/Layout";

const Index = ( props) => (
    <Layout>
    <div>
        <h2>Welcome to BitzPrice</h2>
        <p> Check current Bitcoin rate</p>
        <Prices bpi={props.bpi}/>
    </div>
    </Layout>
)

export default Index;
